  const [isAdmin, setIsAdmin] = useState(false);
  const token = localStorage.getItem("access_token");

  const navigate = useNavigate();

  useEffect(() => {
    axios
      .get("/api/protected", {
        headers: {
          Authorization: `Bearer ${token}`,
        },
